import React from 'react';
import styles from './styles.module.css';

function Input({type,placeholder,value,onChange}){

    return (
        <input
        type={type}
        placeholder={placeholder}
        value={value}
        onChange={onChange}
        className={styles.input-field}
      />
    );

}

export default Input ;
